import React from "react";
import { Link,useNavigate } from "react-router-dom";

const Header = () => {
    let navigate = useNavigate();
    return(
      <div>
        <div className="ui inverted segment">
        <div className="ui inverted secondary pointing menu" style={{display:"flex",justifyContent:"space-between",flexDirection:"row",alignItems:"center"}}>
            <div style={{display:"flex",alignItems:"center",flexDirection:"row"}}>
            <Link to="/"> <div className="ui item"><h4>Home</h4></div></Link>
            <Link to="/notes/list"> <div className="ui item"><h4>Notes</h4></div></Link>
            <Link to="/notes/add"> <div className="ui item"><h4>Create</h4></div></Link>
            <Link to="/notes"> <div className="ui item"><h4>Logout</h4></div></Link>
            </div>

            {/* <div class="ui search" align="right">
            <input class="prompt" type="text" placeholder="Common passwords..."/>
            <div class="results"></div>
            </div> */}
            <div style={{display:"flex",alignItems:"center",flexDirection:"row",justifyContent:"right"}}>
                    <div><h1>React Application</h1> </div>
                    <div ><i className="undo icon" onClick={() => {navigate(-1)}}> </i> </div>
                </div>
        </div>

        </div>


    </div>

    );
}

export default Header;
